import React from "react";
import { Link } from "react-router-dom";

function ShowTodoList({ todos }) {
  return (
    <div>
      <h2>Lista de Tareas</h2>
      <ul>
        {todos.map((todo) => (
          <li key={todo._id}>
            <p>{todo.title}</p>
            <Link to={`/update/${todo._id}`}>Editar</Link>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default ShowTodoList;
